pragma solidity ^0.7.6;
pragma abicoder v2;

interface IFactory {
  struct Grant {
    uint256 id;
    address manager;
    string logo;
    string desc;
    string link;
  }

  struct PoolConfig {
    address WBNB;
    address V3factory;
    address V3PositionManager;
    address V3LPLocker;
    int24 tickLower;
    int24 tickUpper;
